import React, { Component } from 'react';

class Tools extends Component {
  render() {
    return (
      <div className="maintext">
          <h1>
          Some tools that I wrote
          </h1>
	  <ul className='tool-list'>
            <li>
             <a href="app1.teamhua.com">A tool to add in items</a>
     </li>
     </ul>
      </div>
    );
  }
}

export default Tools;
